import Link from "next/link";

import Layout from "../components/Layout";

const Index = () => (
  <Layout>
    <br />
    <Link href="/index">
    <Grid container className={classes.root} spacing={2}>
      <a> Welcome to WHATABYTE! Start Exploring Now</a>
      </Grid>
    </Link>
  </Layout>
);

export default Index;
